import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";

function HomePage() {
  const [races, setRaces] = useState([]);  // Correct way to initialize the state
  const [searchQuery, setSearchQuery] = useState("");
  const [currentPage, setCurrentPage] = useState(1);
  const itemsPerPage = 10;

  useEffect(() => {

    const fetchRaceName = async () => {
      try {
        const response = await fetch(`/races/${raceId}`); // Backend route to get race details by raceId
        const data = await response.json();

        if (data && data.name) {
          setRaceName(data.name); // Set the race name from the response
        } else {
          console.error("Race data not found or missing 'name' field:", data);
          setRaceName("Unknown Race");
        }
      } catch (error) {
        console.error("Error fetching race name:", error);
        setRaceName("Unknown Race");
      }
    };

    const fetchRaces = async () => {
      try {
        const response = await fetch("/races"); 
        const data = await response.json(); 
        setRaces(data);  
        if (Array.isArray(data)) {
          setRaces(data);  
        } else {
          console.error("Fetched data is not an array:", data);
        }
      } catch (error) {
        console.error("Error fetching races:", error);
      }
    };

    fetchRaces();
  }, []); // Empty dependency array means this runs once when the component mounts

  const filteredRaces = races.filter((race) =>
    race.name.toLowerCase().includes(searchQuery.toLowerCase())
  );

  // Calculate the total pages
  const totalPages = Math.ceil(filteredRaces.length / itemsPerPage);

  // Get the races to display based on the current page
  const startIndex = (currentPage - 1) * itemsPerPage;
  const currentRaces = filteredRaces.slice(startIndex, startIndex + itemsPerPage);

  // Handle page changes
  const handleNextPage = () => {
    if (currentPage < totalPages) {
      setCurrentPage(currentPage + 1);
    }
  };

  const handlePrevPage = () => {
    if (currentPage > 1) {
      setCurrentPage(currentPage - 1);
    }
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Bib Transfer Portal</h1>
      <p style={styles.subtitle}>Find or transfer bibs for popular races below:</p>

      {/* Search input */}
      <div style={styles.searchContainer}>
        <input
          type="text"
          placeholder="Search for a marathon..."
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
          style={styles.searchInput}
        />
      </div>

      <ul style={styles.raceList}>
        {currentRaces.map((race) => (
          <li key={race.raceId} style={styles.raceItem}>
            <Link to={`/chat/${race.raceId}`} style={styles.raceLink}>
              {race.name}
            </Link>
            <div style={styles.location}>{race.location}</div>
          </li>
        ))}
      </ul>

      {/* Pagination Controls */}
      <div style={styles.paginationContainer}>
        <button
          onClick={handlePrevPage}
          disabled={currentPage === 1}
          style={styles.paginationButton}
        >
          Previous
        </button>
        <span style={styles.pageNumber}>
          Page {currentPage} of {totalPages}
        </span>
        <button
          onClick={handleNextPage}
          disabled={currentPage === totalPages}
          style={styles.paginationButton}
        >
          Next
        </button>
      </div>
    </div>
  );
}

const styles = {
  container: {
    padding: "40px 20px",
    maxWidth: "800px",
    margin: "0 auto",
    textAlign: "center",
    fontFamily: "'Arial', sans-serif",
    color: "#333",
    lineHeight: 1.6,
  },
  title: {
    fontSize: "2.5rem",
    fontWeight: "bold",
    marginBottom: "10px",
  },
  subtitle: {
    fontSize: "1.2rem",
    marginBottom: "30px",
    color: "#666",
  },
  searchContainer: {
    marginBottom: "20px",
  },
  searchInput: {
    width: "100%",
    padding: "10px",
    fontSize: "1rem",
    borderRadius: "5px",
    border: "1px solid #ccc",
    marginBottom: "20px",
  },
  raceList: {
    listStyleType: "none",
    padding: 0,
    display: "flex",
    flexDirection: "column",
    gap: "15px",
  },
  raceItem: {
    backgroundColor: "#f8f9fa",
    border: "1px solid #ddd",
    borderRadius: "8px",
    transition: "box-shadow 0.3s ease",
  },
  raceLink: {
    display: "block",
    textDecoration: "none",
    color: "#007bff",
    fontSize: "1.2rem",
    fontWeight: "500",
    padding: "10px 15px",
    borderRadius: "8px",
    margin: "0px 0px 0px",
    transition: "background-color 0.3s ease, color 0.3s ease",
  },
  location: {
    fontSize: "1rem",
    color: "#666",
    margin: "0px 20px 10px", 
    fontStyle: "italic",
  },
  paginationContainer: {
    display: "flex",
    justifyContent: "center",
    marginTop: "20px",
  },
  paginationButton: {
    padding: "10px 15px",
    fontSize: "1rem",
    margin: "0 10px",
    border: "1px solid #007bff",
    borderRadius: "5px",
    cursor: "pointer",
    backgroundColor: "#fff",
    color: "#007bff",
    transition: "background-color 0.3s, color 0.3s",
  },
  pageNumber: {
    alignSelf: "center",
    fontSize: "1rem",
    fontWeight: "bold",
  },
};

export default HomePage;
